import React from 'react';
import ScrollableAnchor from 'react-scrollable-anchor';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import { Grid } from '@material-ui/core';

const TechList = () => {
    return (
        <ScrollableAnchor id={'technologies'}>
            <Box my={12} display="flex" alignItems="center" flexDirection="column">
                <Grid container direction="row">
                    <Grid item>
                        <Typography variant="h1" align="center" component="h2" gutterBottom>
                            #01
                        </Typography>
                    </Grid>
                    <Grid item>
                        <Typography variant="h3" align="center" component="h2" gutterBottom>
                            The technologies that we use
                        </Typography>
                        <Typography
                            variant="subtitle1"
                            align="center"
                            component="p"
                            style={{ width: '75%' }}
                            gutterBottom
                        >
                            Above all, we are engineers, and our mission is to find the most elegant and economical
                            solutions for business problems. In our work we use various tools, technologies, and
                            programming languages, the main of them listed below.
                        </Typography>
                    </Grid>
                </Grid>
            </Box>
        </ScrollableAnchor>
    );
};

export default TechList;
